taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");


//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([name] like '%" + db.encode(searchText) + "%') or " +
        "([storeType] like '%" + db.encode(searchText) + "%') or " + 
        "([storecode] like '%" + db.encode(searchText) + "%') or " +
        "([storeqs] like '%" + db.encode(searchText) + "%') or " +
        "([storeloglat] like '%" + db.encode(searchText) + "%') or " +
        "([address] like '%" + db.encode(searchText) + "%') or " + 
        "([storemanager] like '%" + db.encode(searchText) + "%') or " +
        "([status] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM storeInfo " +
    "WHERE ([status] <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT id,name,storeType,storecode,storeqs,storeloglat ,address,storemanager,status,'<span style=\"color:blue;\">查看库存</span>' as operate,'<span style=\"color:blue;\">查看设备</span>' as watchDevices  " +
    "FROM storeInfo " +
    "WHERE (status <> 'DEL') " + condition +
    "ORDER BY id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 

sql= 
    "SELECT distinct status " +
    "FROM storeInfo ";     
var sqlResult1 = db.executeQuery("DB", sql);
if (sqlResult1 == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 

eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,name,storeType,storecode,storeqs,storeloglat,address,storemanager,status,operate,watchDevices", pageSize*(pageCurrent-1), pageSize); 
eio.appendDataSet(sqlResult1,"status", 0, 5);

